import React from "react";
import "./navbar.css"
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import { Button, Grid, Stack } from "@mui/material";



export default function NavBar() {
  return (
    <div>
      <Box>
        <AppBar
          sx={{

            boxShadow: "none",
            padding: "1em 2em",
            color: "#FFFFFF",
            height: "10%"
          }}
          className="navbar"
        >
          <Grid
            container
            direction={"row"}
            coulmnSpacing={{ /*xs: 1, sm: 2, */ md: 4 }}
          >
            <Grid item xs={4}>
              <Typography variant="h5" component="div" className="logo_title" >
                Find-A-Crop
              </Typography>
            </Grid>
            <Grid
              item
              xs={2}
              sx={{
                display: "flex",
                justifyContent: "center",
                paddingLeft: "100px",
              }}
            >
              <Typography variant="h5" component="div" className="main_title">
                Name-A-Crop
              </Typography>
            </Grid>
            <Grid item xs={6}>
              <Stack
                direction="row"
                spacing={7}
                sx={{
                  display: "flex",
                  justifyContent: "flex-end",
                }}
              >
                <Button>
                  <Typography
                    sx={{
                      color: "#ffffff",
                      fontSize: "1.2rem",
                    }}
                  >
                    SIGNUP
                  </Typography>
                </Button>

                <Button
                  variant="contained"
                  sx={{
                    backgroundColor: "#308335",
                  }}
                >
                  <Typography
                    sx={{
                      color: "#ffffff",
                      fontSize: "1.2rem",
                    }}
                  >
                    LOGIN
                  </Typography>
                </Button>
              </Stack>
            </Grid>
          </Grid>
        </AppBar>
      </Box>
    </div>
  );
}
